// prettier.config.js or .prettierrc.js
module.exports = {
  trailingComma: "none",
  tabWidth: 2,
  semi: true,
  singleQuote: false,
};

/* global module:false */

require("es5-shim");
require("es6-shim");

module.exports = function(grunt) {
  grunt.loadNpmTasks("grunt-karma");
  grunt.loadNpmTasks("grunt-contrib-jshint");
  grunt.loadNpmTasks("grunt-contrib-uglify");
  grunt.loadNpmTasks("grunt-contrib-watch");
  grunt.loadNpmTasks("grunt-webpack");
  grunt.loadNpmTasks("grunt-contrib-connect");
  grunt.loadNpmTasks("grunt-jasmine-nodejs");
  grunt.loadNpmTasks("grunt-contrib-clean");

  grunt.initConfig({
    pkg: grunt.file.readJSON("package.json"),

    webpack: {
      dist: require("./config/webpack/dist"),
      test: require("./config/webpack/test"),
      uncompressed: require("./config/webpack/uncompressed")
    },

    "webpack-dev-server": {
      start: {
        webpack: require("./config/webpack/dev"),
        keepalive: true,
        hot: true,
        contentBase: "./",
        inline: true,
        host: "localhost",
        port: 8080,
        disableHostCheck: true
      }
    },

    karma: {
      test: {
        configFile: "./config/karma.conf.js"
      }
    },

    jshint: require("./config/jshint.conf"),

    connect: {
      server: {
        options: {
          port: 8000,
          hostname: "localhost"
        }
      }
    },

    jasmine_nodejs: {
      options: {
        specNameSuffix: "spec.js",
        useHelpers: false,
        stopOnFailure: false,
        reporters: {
          console: {
            colors: true,
            cleanStack: 1,
            verbosity: 1,
            listStyle: "flat",
            activity: true
          }
        }
      },
      test: {
        specs: ["spec/e2e/*.spec.js"]
      }
    },

    clean: {
      all: ["build/*.*"]
    }
  });

  grunt.registerTask("default", ["webpack:uncompressed", "webpack:dist"]);
  grunt.registerTask("test", ["clean:all", "karma", "test-integration"]);
  grunt.registerTask("test-integration", [
    "webpack:test",
    "connect",
    "jasmine_nodejs"
  ]);
  grunt.registerTask("dev", ["webpack-dev-server:start"]);
};

